The framework provides an abstraction to share data between any of the contexts we saw in the previous section (task handlers, init and idle): resources. Resources are data visible only to functions declared within the #[app] module. The framework gives the user complete control over which context can access which resource. All resources are declared as a single struct within the #[app] module. Each field in the structure corresponds to a different resource. The struct must be annotated with the following attribute: #[resources]. Resources can optionally be given an initial value using the #[init] attribute. Resources that are not given an initial value are referred to as late resources and are covered in more detail in a follow-up section in this page. Each context (task handler, init or idle) must declare the resources it intends to access in its corresponding metadata attribute using the resources argument. This argument takes a list of resource names as its value. The listed resources are made available to the context under the resources field of the Context structure. The example application shown below contains two interrupt handlers that share access to a resource named shared. //! examples/resource.rs #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] use panic_semihosting as _; #[rtic::app(device = lm3s6965)]
mod app { use cortex_m_semihosting::{debug, hprintln}; use lm3s6965::Interrupt; #[resources] struct Resources { // A resource #[init(0)] shared: u32, } #[init] fn init(_: init::Context) -> (init::LateResources, init::Monotonics) { rtic::pend(Interrupt::UART0); rtic::pend(Interrupt::UART1); (init::LateResources {}, init::Monotonics()) } // `shared` cannot be accessed from this context #[idle] fn idle(_cx: idle::Context) -> ! { debug::exit(debug::EXIT_SUCCESS); // error: no `resources` field in `idle::Context` // _cx.resources.shared += 1; loop { cortex_m::asm::nop(); } } // `shared` can be accessed from this context // defaults to priority 1 #[task(binds = UART0, resources = [shared])] fn uart0(mut cx: uart0::Context) { let shared = cx.resources.shared.lock(|shared| { *shared += 1; *shared }); hprintln!("UART0: shared = {}", shared).unwrap(); } // `shared` can be accessed from this context // explicitly set to priority 2 #[task(binds = UART1, resources = [shared], priority = 2)] fn uart1(mut cx: uart1::Context) { let shared = cx.resources.shared.lock(|shared| { *shared += 1; *shared }); hprintln!("UART1: shared = {}", shared).unwrap(); }
} $ cargo run --example resource
UART1: shared = 1
UART0: shared = 2 Note that the shared resource cannot be accessed from idle. Attempting to do so results in a compile error.

