Critical sections are required to access shared mutable data in a data race-free manner. The resources field of the passed Context implements the Mutex trait for each shared resource accessible to the task. The only method on this trait, lock , runs its closure argument in a critical section. The critical section created by the lock API is based on dynamic priorities: it temporarily raises the dynamic priority of the context to a ceiling priority that prevents other tasks from preempting the critical section. This synchronization protocol is known as the Immediate Ceiling Priority Protocol (ICPP) , and complies with Stack Resource Policy(SRP) based scheduling of RTIC. In the example below we have three interrupt handlers with priorities ranging from one to three. The two handlers with the lower priorities contend for the shared resource and need to lock the resource for accessing the data. The highest priority handler, which do nat access the shared resource, is free to preempt the critical section created by the lowest priority handler. //! examples/lock.rs #![deny(unsafe_code)]
#![deny(warnings)]
#![no_main]
#![no_std] use panic_semihosting as _; #[rtic::app(device = lm3s6965)]
mod app { use cortex_m_semihosting::{debug, hprintln}; use lm3s6965::Interrupt; #[resources] struct Resources { #[init(0)] shared: u32, } #[init] fn init(_: init::Context) -> (init::LateResources, init::Monotonics) { rtic::pend(Interrupt::GPIOA); (init::LateResources {}, init::Monotonics()) } // when omitted priority is assumed to be `1` #[task(binds = GPIOA, resources = [shared])] fn gpioa(mut c: gpioa::Context) { hprintln!("A").unwrap(); // the lower priority task requires a critical section to access the data c.resources.shared.lock(|shared| { // data can only be modified within this critical section (closure) *shared += 1; // GPIOB will *not* run right now due to the critical section rtic::pend(Interrupt::GPIOB); hprintln!("B - shared = {}", *shared).unwrap(); // GPIOC does not contend for `shared` so it's allowed to run now rtic::pend(Interrupt::GPIOC); }); // critical section is over: GPIOB can now start hprintln!("E").unwrap(); debug::exit(debug::EXIT_SUCCESS); } #[task(binds = GPIOB, priority = 2, resources = [shared])] fn gpiob(mut c: gpiob::Context) { // the higher priority task does still need a critical section let shared = c.resources.shared.lock(|shared| { *shared += 1; *shared }); hprintln!("D - shared = {}", shared).unwrap(); } #[task(binds = GPIOC, priority = 3)] fn gpioc(_: gpioc::Context) { hprintln!("C").unwrap(); }
} $ cargo run --example lock
